import './layout.scss';
import Navbar from '../../component/navbar/Navbar';

import { Outlet } from 'react-router-dom';

function Layout() {
  return (
    <div className="layout">
      <div className="navbar">
        <Navbar />
      </div>
      <div className="content">

        <Outlet />
      </div>
    </div>
  );
}

export default Layout;
